import React from 'react';
import './Main.css';

function Main() {
  return (
    <div className="Main">
      <h1>Главная</h1>
      <h2>Добро пожаловать на сайт!</h2>
      <p><br/>Для подсчёта ипотеки переёдите на вкладку Калькуляторы.</p>
      <p><br/>Перед входом во вкладку Администратор <br/>введите данные для входа во вкладке Вход</p>
      <img src="../images/portland.png" alt="portlandlogo"/>
    </div>
  );
}

export default Main;
